import { useEffect } from "react"
import TitleDetail from "./TitleDetail"
import axios from "axios"

function ShowTile(){

    useEffect(()=>{
        axios.get('https://jsonplaceholder.typicode.com/posts')
        .then((data)=>{
            console.log(data);
        })
    })
    return (
        <div>
            <TitleDetail/>
        </div>
    )
}
export default ShowTile
